import { useEffect, useState } from "react";
import "./dropdown_box.css"

function dropdown_box(props) {
    const[toggleVal, setToggle] = useState(false);

    return (
        <div>
            {
                (toggleVal) ? (
                    <div>True</div>
                ) : (
                    <div>False</div>
                )
            }
        </div>
    )
}

export default dropdown_box;
